import React, { useEffect } from "react";
import styled from "@mui/system/styled";
import { Box, InputLabel, MenuItem, Select, ToggleButton, ToggleButtonGroup } from "@mui/material";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import { useNavigate } from "react-router-dom";
import { useState } from "react";

const Item = styled("div")(({ theme }) => ({
  padding: theme.spacing(1),
  textAlign: "center",
}));

const ProductsList = () => {
  const navigate = useNavigate();
  useEffect(() => {
    let flag = localStorage.getItem("isLogin");
    if (flag === "false") {
      navigate("/Login");
    }
  });
  const [alignment, setAlignment] = useState("web");
  const [age, setAge] = React.useState('');

  const handleChangeFilter = (event) => {
    setAge(event.target.value);
  }
  const handleChange = (event, newAlignment) => {
    setAlignment(newAlignment);
  };

  return (
    <Box sx={{ width: "100%" }}>
        <Grid2
          container
          direction="row"
          justifyContent="center"
          alignItems="center"
          xs={11}
        >
          <Item>
            <ToggleButtonGroup
              color="primary"
              value={alignment}
              exclusive
              onChange={handleChange}
              aria-label="Platform"
            >
              <ToggleButton value="all">All</ToggleButton>
              <ToggleButton value="apparel">APPAREL</ToggleButton>
              <ToggleButton value="electronic">ELECTRONIC</ToggleButton>
              <ToggleButton value="personalcare">PERSONAL CARE</ToggleButton>
            </ToggleButtonGroup>
          </Item>
        </Grid2>
        <Grid2
          container
          direction="row"
          sx={{ml:10}}
        >
          Sort By: <select>
            <option>1</option>
            <option>2</option>
            <option>3</option>
          </select>
        </Grid2>
    </Box>
  );
};

export default ProductsList;
